import React from 'react'

function Finish() {
    let right=JSON.parse(localStorage.getItem("right"))
    let wrong=JSON.parse(localStorage.getItem("wrong"))

    console.log("right answers",right)
    console.log("wrong answers",wrong)

  return (
    <div>

<div className="container">
        <div className="row">
            <h1>My Interview Portal</h1>

            <div className="col-md-12">
                <div className="panel panel-default">
                    {/* <div className="panel-heading">AngularJS Test - Result</div> */}
                    <div className="panel-body">
                        {/* <center> */}
                            <h2 className="">Total no of Questions: 10</h2>
                            <h3 className="text-success">Correct Answers: {right==null? "0": {right}}
                            <span className="text-danger">Wrong Answers: {wrong==null? "0": {wrong}} </span></h3>
                        {/* </center> */}
                    </div>
                </div>
            </div>
        </div>
    </div>

    </div>
  )
}

export default Finish
